import React from "react";
import { motion } from "framer-motion";

const skills = [
  { name: "HTML", level: 4, icon: "data:image/png;base64," },
  { name: "CSS", level: 4, icon: "data:image/png;base64," },
  { name: "JavaScript", level: 2.5, icon: "data:image/jpeg;base64," },
  { name: "React", level: 3, icon: "data:image/png;base64," },
  { name: "Tailwind", level: 3.5, icon: "data:image/jpeg;base64," },
  { name: "Java", level: 3.5, icon: "data:image/png;base64," },
  { name: "Pyhton", level: 3, icon: "data:image/jpeg;base64," },
  { name: "C", level: 3, icon: "data:image/jpeg;base64," },
  { name: "MongoDB", level: 2, icon: "data:image/png;base64," },
  { name: "MySQL", level: 3.5, icon: "data:image/png;base64," },
];

const getRandom = (min, max) => Math.random() * (max - min) + min;

export default function SkillsBubbles() {
  return (
    <section
      id="skills"
      className="min-h-screen py-20 sm:px-8 md:px-40 lg:px-40"
    >
      <h2 className="mt-15 text-white text-4xl font-bold text-center mb-15">
        My Skills
      </h2>

      <div className="flex flex-wrap justify-center gap-10">
        {skills.map((skill, idx) => {
          const size = 100 + skill.level * 10;
          const duration = `${Math.random() * 6 + 6}s`;
          const delay = `${Math.random() * 3}s`;

          return (
            <motion.div
              key={idx}
              className="relative flex items-center justify-center rounded-full shadow-lg overflow-hidden"
              style={{
                width: `${size}px`,
                height: `${size}px`,
                animation: `floatBubble ${duration} ease-in-out infinite`,
                animationDelay: delay,
              }}
              initial={{ opacity: 0, y: 50, scale: 0.8 }}
              whileInView={{ opacity: 1, y: 0, scale: 1 }}
              transition={{ duration: 0.8, delay: idx * 0.2, type: "spring", stiffness: 100 }}
              viewport={{ once: false, amount: 0.3 }}
            >
              <motion.img
                src={skill.icon}
                alt={skill.name}
                className="w-full h-full object-cover"
                whileHover={{ scale: 1.1 }}
              />

              {/* Tooltip with Framer Motion */}
              <motion.span
                className="absolute bottom-full left-1/2 -translate-x-1/2 mb-2 px-2 py-1 text-xl rounded bg-black text-white shadow-lg whitespace-nowrap"
                initial={{ opacity: 0, y: 10 }}
                whileHover={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.3 }}
              >
                {skill.name}
              </motion.span>
            </motion.div>

          );
        })}
      </div>

      {/* Bubble floating animation */}
      <style>
        {`
          @keyframes floatBubble {
            0% { transform: translateY(0); }
            50% { transform: translateY(-10px); }
            100% { transform: translateY(0); }
          }
        `}
      </style>
    </section>
  );
}